import React from 'react';
import s from './escort.module.scss';
import Link from 'next/link';
import fav from '../../assets/images/main/signs/favorite-pink.png';
import crown from '../../assets/images/main/signs/crown-pink.png';
import star from '../../assets/images/main/signs/star-pink.png';
import plane from '../../assets/images/main/signs/plane-pink.png';
import VerifiedWindow from '../modal-window/VerifiedWindow';

import model from '../../assets/images/main/horizontal/model-1.png'

export default function EscortGrid({ posts }) {
  return (
    <div style={{
      maxWidth: '1260px',
      margin: '1em auto',
      padding: '0 0 5em 0'
    }} >
      {posts && posts.length ?
        posts.map((post, i) => {
          return <div key={i}>
            <div className={s.vertical_slide}>
              <div className={s.vertical_slide_image}>
                <img src={post.photo_horizontal} alt={post.model_name} className={s.model_photo} />
              </div>
              <div className={s.vertical_slide_model_info}>
                <div>
                  <h5 className={`text-white ${s.name}`}>{post.model_name}</h5>
                  <div className={s.network_status}>Online</div>
                  <div className={`text-white ${s.location}`}>Location</div>
                  <p className={`text-white ${s.summary}`}>{post.summary}</p>
                </div>
                <div className={s.card_control}>
                  <div>
                    <img src={fav} alt="" />
                  </div>
                  <div>
                    <img src={crown} alt="" />
                  </div>
                  <div>
                    <img src={star} alt="" />
                  </div>
                  <div>
                    <img src={plane} alt="" />
                  </div>
                </div>
                <div className={`text-white ${s.verification}`}>
                  <span className={s.verified}><VerifiedWindow buttonLabel={`VERIFIED`} /><i></i></span>
                  <span className={s.view_profile}>
                    <Link href="/modelProfile"><a className="btn text-white">
                      VIEW PROFILE
                  </a></Link>
                  </span>
                </div>
              </div>
            </div>
          </div>
        })
        : <div className="h1 text-info text-center py-5">No posts...</div>}
    </div>
  )
}


